class Solution {

    /**
     * @param Integer[] $nums1
     * @param Integer[] $nums2
     * @return Integer
     */
    function minSum($nums1, $nums2) {
        $sum1 = array_sum($nums1);
        $sum2 = array_sum($nums2);
        $zeros1 = count(array_filter($nums1, function($val) { return $val === 0; }));
        $zeros2 = count(array_filter($nums2, function($val) { return $val === 0; }));

        if ($sum1 == $sum2 && $zeros1 == 0 && $zeros2 == 0) {
            return $sum1; // No zeros and sums are equal
        }

        for ($i = 1; ; $i++) {
            $newSum1 = $sum1 + $zeros1 * $i;
            $newSum2 = $sum2 + $zeros2 * $i;
            if ($newSum1 == $newSum2) {
                return $newSum1;
            } elseif ($newSum1 > $newSum2 && $zeros2 == 0 || $newSum2 > $newSum1 && $zeros1 == 0) {
                return -1; // Impossible to make sums equal
            }
        }
    }
}
